import React from 'react';
import { 
  Heading, 
  Paragraph, 
  Card, 
  Tag 
} from '@digdir/designsystemet-react';
import Timeline from '../components/Timeline';

interface ChangelogEntry {
  version: string;
  date: string;
  type: 'feature' | 'bugfix' | 'improvement';
  title: string;
  description: string;
}

const changelog: ChangelogEntry[] = [
  {
    version: '1.2.0',
    date: '2024-01-15',
    type: 'feature',
    title: 'New Component Library',
    description: 'Introduced a comprehensive set of new components.'
  },
  {
    version: '1.1.1',
    date: '2024-01-10',
    type: 'bugfix',
    title: 'Performance Improvements',
    description: 'Fixed various performance issues and memory leaks.'
  },
  {
    version: '1.1.0',
    date: '2024-01-05',
    type: 'improvement',
    title: 'Enhanced Documentation',
    description: 'Added detailed documentation for all components.'
  }
];

const Changelog: React.FC = () => {
  const getVersionColor = (type: ChangelogEntry['type']) => {
    switch (type) {
      case 'feature':
        return 'success';
      case 'bugfix':
        return 'first';
      case 'improvement':
        return 'second';
      default:
        return 'neutral';
    }
  };

  return (
    <div>
      <Heading level={1} size="xlarge" spacing>
        Changelog
      </Heading>
      <Paragraph spacing>
        Track the latest updates and improvements to the Designsystemet components.
      </Paragraph>

      <Timeline items={changelog.map((entry) => (
        <Timeline.Item key={entry.version}>
          <Card>
            <div style={{ padding: '1rem' }}>
              <div style={{ display: 'flex', alignItems: 'center', gap: '1rem', marginBottom: '1rem' }}>
                <Tag size="small" color={getVersionColor(entry.type)}>
                  v{entry.version}
                </Tag>
                <Tag size="small" color={getVersionColor(entry.type)}>
                  {entry.type}
                </Tag>
                <span style={{ color: '#666', fontSize: '0.875rem' }}>
                  {entry.date}
                </span>
              </div>
              <Heading level={3} size="small" spacing>
                {entry.title}
              </Heading>
              <Paragraph>
                {entry.description}
              </Paragraph>
            </div>
          </Card>
        </Timeline.Item>
      ))}>
      </Timeline>
    </div>
  );
};

export default Changelog;
